import Head from 'next/head';

// Navigation:
import Nav from './Navigation/Main/Nav';
import Footer from './Footer/Footer';

const Layout = (props) => (
    <div>
        <Head>
            <title> Kaitlyn Bess Riel </title>
        </Head>
        {/* Navbar first */ }
        { props.children }
        { /* Footer last */ }
    </div>
)

export default Layout;
